import { Divider } from "@material-ui/core";
import React from "react";
import axios from 'axios';



export function ListApplications( {
    props
}) {
    const getApps = () => {
        const [apps, setApps] = React.useState('No Apps')

        axios.get('http://localhost:5001/api/applist').then(data => {
            setApps(data)
        })

        return (
            <div>
                <p>{apps}</p>
            </div>   
        )
    }
}
